import React from 'react';
import * as module from '../moduleTraitement/generate_synoptique'

export class ArbrePage extends React.Component {
    constructor(props) {
      super(props)
      this.state = {
        myDiagramDivId : "myDiagramDiv",
        dataMyDiagramDiv: "myDiagramDiv2"
        };
    }
    componentDidMount() {
        this.timerID = this.functionAffichageDiagram()
        console.log(this.timerID )
      }
    componentWillUnmount() {
        clearInterval(this.timerID);
      }
    render() {
        const myDiagramDivStyle = {
            backgroundColor: 'white',
            border: '1px solid black',
            width: '100%',
            height: '100vh',
            position: 'relative',
          };
        this.functionAffichageDiagram = () => {
            module.generateSynoptique(module.nodeDataArray2, module.linkDataArray2, "myDiagramDiv");
        };
      return (
            <div className="container-fluid">
                <div id="divGlobalDiagram" className="">
                    <input id="mySearch" className="m-2" type="search" placeholder="Chercher par Prenom"></input>
                        <button id="" className="btn btn-primary m-2">Chercher</button>
                    <div id="myDiagramDiv" className="mt-3" style={myDiagramDivStyle}>
                        
                    </div>
                </div>
                
            </div>
      );
    }
  }
